import React from "react";

import "../css/styles.css";

const MyApp = ({Component, pageProps}) => {
    return (
        <div>
            <div className = "bg-gray-200">
                PalpiteBox
            </div>
            <Component {...pageProps} />
        </div>
    )
};

export default MyApp;
